import Operation from '../../../components/operation.vue'
export default {
    components: {
        Operation
    },
    data() {
        return {
            tabList: [
                { label: '已发布的API', name: 'publish'},
                { label: '未发布的API', name: 'unpublished'},
            ],
            fourthList: [],
            // 分页
            pageSize: 9,
            currentPage: 1,
            total: 50,
            tableData: [],
        }
    },
    beforeCreate() {},
    created() { 
        this.initList()
    },
    methods: {
        // 初始化列表
        initList() {
            let request = {
                page: String(this.currentPage),
                size: String(this.pageSize),
                driverType: '',
                assetsState: 'publish',
                contacts: '',
                application: '',
                contentsOne: '',
                contentsTwo: '',
                contentsThree: '',
            }
            this.$api.getAppointApi(request).then(res => {
                if(res.data) {
                    this.tableData = res.data.records
                    this.total = res.data.total
                }
            })
        },
        // 查询列表
        queryList(request) {
            this.$api.getAppointApi(request).then(res => {
                this.tableData = res.data.records
                this.total = res.data.total
            })
        },
        // 修改发布状态
        offline(request) {
            this.$api.updateApiState(request).then(res=>{
                this.$message.success('操作成功!')
                this.initList()
            })
        },
        // 树状图tab
        handleClick(tab,event) {
            console.log(tab,event);
        },
        // 节点点击
        handleNodeClick(data) {
            console.log(data, '点击');
        },
    }
}
